import React from 'react';

function App() {
  return (
    <div className="container pt-3">
        <div className="row">
            <div className="col">
                FORM
            </div>
        </div>
        <div className="row">
            <div className="col">
               POSTS
            </div>
        </div>
        <div className="col">
            FETCHED POSTS
        </div>
    </div>
  );
}

export default App;
